    <AnimatedSection>
    <section className='hero_section' style={{ backgroundImage: `url(${heroImage})` }}>
      <div className="hero_content">
        <h2>Level Up Your Insta-Game</h2>
        <button className="cta-button">Get Started!</button>
      </div>
    </section>
